import React from 'react';
import { connect } from 'react-redux';
import './App.css';

function App(props) {
  return (
    <div className="App">
      {props.name}
      {props.add}
    </div>
  );
}
const MapToProps = (state) => ({
  name: state.name,
  add:state.add
});

export default connect(MapToProps, {})(App);
